class Clase1:    def __init__(self, nombre = None, apellido_p = None, apellido_m = None):        self.nombre = nombre        self.apellido_paterno = apellido_p        self.apellido_materno = apellido_m        def imprimir(self):        print(f"La persona se llama {self.nombre} {self.apellido_paterno} {self.apellido_materno}")        def __str__(self):        return f"La persona se llama {self.nombre} {self.apellido_paterno} {self.apellido_materno}"    persona1 = Clase1("Juan", "Carlos", "Holguin")persona2 = Clase1("Luis", "Alonso", "Holguin")persona1.imprimir()print(persona1)